import React,{FC} from 'react';


export enum CardVariant{
    outline = ''
}

interface CardProps {
    width: string;
    height: string;
    children?: React.ReactNode
}

export const Card:FC<CardProps> =({width, height, children})=>{
    return(
        <div style={{width, height}}>
            {children}
        </div>
    )
}
